class Solution(object):
    def minDominoRotations(self, A, B):
        v1 = A[0]
        v2 = B[0]
        v1Valid = True
        v2Valid = True

        numSwapsC1 = [0, 1]
        numSwapsC2 = [1, 0]

        for i in range(1, len(A)):
            if v1Valid:
                if v1 != A[i] and v1 != B[i]:
                    v1Valid = False
            if v2Valid:
                if v2 != A[i] and v2 != B[i]:
                    v2Valid = False

            if not v1Valid and not v2Valid:
                return -1

            if A[i] == B[i]:
                continue

            if A[i] == v1:
                numSwapsC2[0] += 1
            if B[i] == v1:
                numSwapsC1[0] += 1

            if A[i] == v2:
                numSwapsC2[1] += 1
            if B[i] == v2:
                numSwapsC1[1] += 1

        if v1Valid and v2Valid:
            return min(min(numSwapsC1[0], numSwapsC2[0]), min(numSwapsC2[1], numSwapsC1[1]))
        elif v1Valid:
            return min(numSwapsC1[0], numSwapsC2[0])
        else:
            return min(numSwapsC2[1], numSwapsC1[1])

